import itertools
import bisect

def find_factorials_with_trailing_zeroes(m):
    degs = [0 for i in range(5 * m + 6)]
    deg = 6
    while deg < 5 * m + 1:
        for i in range(deg, 5 * m + 6, deg):
            degs[i] += 1
        deg *= 5
    prefix = list(itertools.accumulate(degs))
    i = bisect.bisect_left(prefix, m)
    ans = []
    for j in range(i, min(i + 5, 5 * m + 6)):
        if prefix[j] == m:
            ans.append(j)
    return (len(ans), ans)

